import React, { useState, useEffect } from "react";
import { Route } from "react-router-dom";
import axios from "axios";

// clients
import Users from "./components/pages/user/User";
import UpdateUser from "./components/pages/clients/UpdateUser";

function Client() {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    axios
      .get(" http://localhost:4000/api/clients")
      .then((res) => setPosts(res.data))
      .catch((error) => console.log(error));
  });

  return (
    <div className="Client">
      {/* Get Data */}
      <Route exact path="/clients" render={() => <Users posts={posts} />} />

      {/* Add Data */}

      <Route path="/add-client" component={AddClient} />

      {/* Update Data */}
      <Route
        path="/update-client/:id"
        render={(props) => <UpdateClient {...props} posts={posts} />}
      />
    </div>
  );
}

export default Client;
